class RocketParent extends React.Component {
	render() {
		const rockets = this.props.rockets;
		const rocketsArr = [];
		for (let key in rockets){
			rocketsArr.push(`${rockets[key]}`);
		};
		console.log(rocketsArr);

		return (
			<div>
				{rocketsArr.map(array2 => (
					<p key={array2.id}>{array2.id}</p>
				))}
			</div>
		);
	};
};

function Rocket() {

};

export default RocketParent;
